description:
Verenigde Staten
Actie / Sciencefiction
124 minuten

goed

met Tom Cruise, Olga Kurylenko en Morgan Freeman

De wereld is vergaan door een jarenlange nucleaire oorlog. De overlevenden kunnen niet meer op de grond leven en zijn 
genoodzaakt om op wolkenniveau een nieuw bestaan op te bouwen. Beneden op de aarde leven aliens die tegen de straling kunnen. 
Soldaat Jack Harper is een van de laatste robotreparateurs op aarde als onderdeel van een grote operatie om belangrijke 
grondstoffen te verkrijgen. Zijn missie zit er bijna op, totdat hij een vreemdeling redt uit een neergestort ruimteschip.
